def hex_list():
    test = []
    i = 0
    while i <= 255:
        data_hex = hex(i)
        if len(data_hex) < 4:
            data_replace = data_hex[0:2] + '0' + data_hex[2]
            data_replace = data_replace.lstrip('0')
        else:
            data_replace = data_hex.lstrip('0')
        test.append(data_replace)
        i += 1
    return test


def decode(data):
    data_str = str(binascii.a2b_hex(data))
    for x in hex_list():
        data_str = data_str.replace('b\'', '').replace('\'', '').replace('\\n', '').replace('\\r', '').replace('\\' + x,
                                                                                                               '')
    return data_str


